import { useState } from "react";

import "./ExerciseForm.css";

import { Link } from "react-router-dom";
import { useNavigate } from "react-router-dom";

import axios from "axios";

const categoryOptions = [
  { key: 1, label: "Endurance", value: "endurance" },
  { key: 2, label: "Strength", value: "strength" },
  { key: 3, label: "Flexibility", value: "flexibility" },
  { key: 4, label: "Balance", value: "balance" },
];

export default function ExerciseForm() {
  const [form, setForm] = useState({
    exercise_name: "",
    category: "",
    date: "",
    duration: "",
    intensity: 0,
  });
  const [errors, setErrors] = useState({});
  const [isLoading, setIsLoading] = useState(false);
  const navigate = useNavigate

  const handleOnInputChange = (event) => {

      if (form.intensity > 10) {
        console.log("In here?")
        setErrors((e) => ({
          ...e,
          intensity: "Intensity cannot be greater than 10 or less than 0",
        }));
      } else {
        setErrors((e) => ({ ...e, intensity: null }));
      }

    setForm((f) => ({ ...f, [event.target.name]: event.target.value }));
  };

 console.log("Form?", form)


 const handleOnSubmit = async () => {
  setIsLoading(true)
  setErrors((e) => ({ ...e, form: null }))

  if (form.passwordConfirm !== form.password) {
    setErrors((e) => ({ ...e, passwordConfirm: "Passwords do not match." }))
    setIsLoading(false)
    return
  } else {
    setErrors((e) => ({ ...e, passwordConfirm: null }))
  }

  try {
    const res = await axios.post("http://localhost:3001/auth/register", {
      date: form.date,
      location: form.location,
      first_name: form.first_name,
      last_name: form.last_name,
      email: form.email,
      password: form.password,
    })

    if (res?.data?.user) {
      setIsLoading(false)
      navigate("/portal")
    } else {
      setErrors((e) => ({ ...e, form: "Something went wrong with registration" }))
      setIsLoading(false)
    }
  } catch (err) {
    console.log(err)
    const message = err?.response?.data?.error?.message
    setErrors((e) => ({ ...e, form: message ? String(message) : String(err) }))
    setIsLoading(false)
  }
}
  return (
    <div className="Register">
      <div className="media"></div>
      <div className="card">
        <h2>Add Exercise</h2>

        {errors.form && <span className="error">{errors.form}</span>}
        <br />

        <div className="form">
          <div className="input-field">
            <label htmlFor="name">Name</label>
            <input
              type="text"
              name="exercise_name"
              placeholder="Jane"
              value={form.exercise_name}
              onChange={handleOnInputChange}
            />
          </div>

          <div className="input-field">
            <label htmlFor="name">Select a date</label>
            <input
              type="date"
              name="date"
              value={form.date}
              onChange={handleOnInputChange}
            />
          </div>

          <div className="input-field">
            <label htmlFor="name">Category</label>
            <select
              name="category"
              onChange={(event) =>
                setForm((f) => ({ ...f, category: event.target.value }))
              }

              value = {form.category}
            >
              {categoryOptions.map((category) => (
                <option key={category.key} value={category.label}>
                  {category.label}
                </option>
              ))}

            </select>
          </div>



          <br />

          <div className="split-inputs">
            <div className="input-field">
              <label htmlFor="name">Duration(min)</label>
              <input
                type= "number"
                name="duration"
                placeholder="1"
                value={form.duration}
                onChange={handleOnInputChange}
              />
            </div>
            <div className="input-field">
              <label htmlFor="name">Intensity</label>
              <input
                type="number"
                name="intensity"
                placeholder="1"
                value={form.intensity}
                onChange={handleOnInputChange}
              />
             </div>


          </div>

          {errors.intensity && (
                <span className="error">{errors.intensity}</span>
              )}

          <button> Save</button>
        </div>
      </div>
    </div>
  );
}
